import React from 'react';
import DataTable from 'react-data-table-component';
import { Link } from 'react-router-dom';

class UserData extends React.Component {

    render() {
        const columns = [
            {
                name: 'ID',
                selector: 'id',
                sortable: true,
            },
            {
                name: 'Name',
                selector: 'name',
                sortable: true,
            },
            {
                name: 'User Type',
                selector: 'user_type',
                sortable: true,
            },
            {
                name: 'Actions',
                selector: 'actions',
            }
          ];
        const data = [
            {
                id: 1,
                name: 'Manogna',
                user_type: 'Admin',
                actions: <Link to='/project'>Login</Link>
            },
            {
                id: 1,
                name: 'Thanusha',
                user_type: 'Manager',
                actions: <Link to='/project'>Login</Link>
            },
            {
                id: 1,
                name: 'Sajida',
                user_type: 'Developer',
                actions: <Link to='/project'>Login</Link>
            }
        ]
        return (
            <div className="col-md-6 col-md-offset-3">
                <h2>User List</h2>
                <DataTable 
                columns={columns}
                data={data}
                />
            </div>
        )
    }
}

export default UserData;
